import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom'; // Import useNavigate hook

const NominatorDashboard = () => {
    const [nominees, setNominees] = useState([]);
    const navigate = useNavigate(); // Initialize navigate function

    useEffect(() => {
        axios.get('http://127.0.0.1:5000/nominee/dashboard')
          .then(response => {
            // Set the nominees state with the data received from the backend
            setNominees(response.data.all_nominees_nominator);
          })
          .catch(error => {
            console.error('Error fetching nominees:', error);
          });
      }, []);

    const handleLogout = () => {
        // Perform logout logic here (e.g., clear user token from local storage)
        localStorage.removeItem('userToken');

        // Redirect to registration page after logout
        navigate('/');
      };

    return (
      <div>
        <header>
          {/* Header content */}
        </header>
        <main role="main">
          {/* Main content */}
          <div className="row">
            <table className="table">
              <thead>
                <tr>
                  <th>Nominee Name</th>
                  <th>Nominator</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {nominees && nominees.length > 0 ? (
                  nominees.map(nominee => (
                    <tr key={nominee.id}>
                      {/* Render nominee data */}
                      <td>{nominee.first_name} {nominee.last_name}</td>
                      <td>{nominee.nominator.full_name}</td>
                      <td>
                        {/* Links to nominee actions */}
                        <Link to={`/nominee/${nominee.id}/edit`}>Edit</Link>
                        <Link className="text-danger" to={`/nominee/${nominee.id}/delete`}>Delete</Link>
                        <Link to={`/nominee/${nominee.id}/info`}>View</Link>
                      </td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="3">Loading...</td>
                  </tr>
                )}
              </tbody>
            </table>
            <div>
              <Link to="/nominee/new" className="btn btn-success">Submit New Nominee</Link>
            </div>
          </div>
          <div className="col-md-4">
            <Link to="/dashboard" className="btn btn-warning">Back</Link>
            <button onClick={handleLogout} className="btn btn-danger">Logout</button>
          </div>
        </main>
      </div>
    );
};

export default NominatorDashboard;
